import React, { Component } from "react";
import Cookies from "universal-cookie";
import Api from "../../api";
import {
  Header,
  Icon,
  Container,
  Button,
  Modal,
  Label,
  Accordion,
  Grid,
  Segment,
  Transition,
  Form,
  Radio,
  Card
} from "semantic-ui-react";

const api = new Api();
const cookies = new Cookies();

class AllStatusViewer extends Component {
  state = {
    group: this.props.group,
    environment: cookies.get("userEnv")
  };

  triggerResponse = res => {
    console.log(res);
  };

  render() {
    return (
      <div>
        <p>Status for All: {this.state.group} </p>
      </div>
    );
  }
  componentWillMount() {
    // console.log(this.props.group);
    // if (this.props.group === "all") {
    api.trigger(this.state.environment, "status", this.triggerResponse);
    // }
  }
}

export default AllStatusViewer;
